import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Card } from 'react-bootstrap';
import OffresData from 'OffresData.json';

export default function Offre(){
    return(
        <>
            {OffresData.map((OffreData)=>{
                return(
                    <Card>
                        <Card.Body>
                            <Card.Title>{offreData.title}</Card.Title>
                            <Card.Subtitle className="mb-2 text-muted">{offresData.company}</Card.Subtitle>
                            <Card.Text>
                            <strong>Location:</strong> {offresData.location}<br />
                            <strong>Job Type:</strong> {offresData.jobType}
                            </Card.Text>
                            <Card.Text>
                            <strong>Description:</strong> {offresData.description}
                            </Card.Text>
                        </Card.Body>
                    </Card>
                )
            })}
        </>
    )
}
